import http from "../http-common";

class UserManagementDataService {
  getAll() {
    return http.get("/person-management");
  }

  get(person_id) {
    return http.get(`/person-management/${person_id}`);
  }

  create(data) {
    return http.post("/person-management", data);
  }

  update(person_id, data) {
    return http.put(`/person-management/${person_id}`, data);
  }

  delete(person_id) {
    return http.delete(`/person-management/${person_id}`);
  }

  findByUsername(person_id) {
    return http.get(`/person-management?person_id=${person_id}`);
  }
}

export default new UserManagementDataService();
